def my_func(input1: str):
    if len(input1) < 1 or len(input1) > 20:
        return ""
    parts = input1.split(" ")
    result = []
    for part in parts:
        subparts = part.split("-")
        transformed_subparts = [subparts[0]] + [s.capitalize() for s in subparts[1:]]
        result.append("".join(transformed_subparts))
    return " ".join(result)
